import React from 'react'
import styled from 'styled-components'

const Image = styled.div`
  background-color: white;
  height: 208px;
`

const Title = styled.h1`
  font-size: 24px;
  margin: 0;
`

const Container = styled.div`
  background-color: #010409;
  width: 248px;
  color: white;
  padding: 24px 16px;
`

const Card = () => {
  return (
    <Container>
      <Title>EMF 5</Title>
      <Image />
    </Container>
  )
}

export default Card
